const BackgroundLayer = ({name}: { name: BackgroundLayerName }) => {
    if (!name) return <></>

    return (
        <div className="background-layer">
            {name === 'straight-left' && (<LeftStraight/>)}
            {name === 'straight-right' && (<RightStraight/>)}
            {name === 'purple-left' && (<LeftPurple/>)}
            {name === 'purple-right' && (<RightPurple/>)}
            {name === 'yellow-left' && (<LeftYellow/>)}
            {name === 'yellow-right' && (<RightYellow/>)}
            {name === 'blue-left' && (<LeftBlue/>)}
            {name === 'blue-right' && (<RightBlue/>)}
        </div>
    )
}

export default BackgroundLayer;
